import React, { Component } from 'react'
import { SafeAreaView, View, Text, TextInput, Button, Alert, StyleSheet, ActivityIndicator } from 'react-native'
import axios from 'axios'
import { SafeAreaProvider, SafeAreaInsetsContext, useSafeAreaInsets } from 'react-native-safe-area-context'
import { NavigationContainer } from '@react-navigation/native'
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs'
import { Ionicons, FontAwesome5, FontAwesome } from '@expo/vector-icons'

import Header from './components/Header'
import { Game, GameList, SportSelector, Team, HomeScreen } from './components/Exports'

function HomeScreenTab() {
    return (
      <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
        {/* <SportSelector /> */}
        <HomeScreen />
      </View>
    );
  }

  function ProfileScreenTab() {
    return (
      <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
        <Text>Profile</Text>
      </View>
    );
  }

  function RewardsScreenTab() {
    return (
      <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
        <Text>Rewards</Text>
      </View>
    );
  }

  function BetslipScreenTab() {
    return (
      <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
        <Text>Betslip</Text>
      </View>
    );
  }

  const Tab = createBottomTabNavigator();
//   const insets = useSafeAreaInsets();


export default class Main extends Component {

    constructor(props) {
        super(props)

    }

    render() {
        return (
            <>
                <Header />
                <NavigationContainer>
                        <Tab.Navigator   
                            tabBarOptions={{
                                initialRouteName: "Home",
                                activeBackgroundColor: '#161616',
                                inactiveBackgroundColor: '#161616',
                                activeTintColor: '#1398A0',
                                inactiveTintColor: 'grey',
                        }}
                        screnOptions={({ route }) => {
                            let iconName

                            if (route.name === "Home") {
                                iconName = focused 
                                ? 'home'
                                : 'home'

                                return <FontAwesome5 name={iconName} size={24} color="white" />
                            }
                        }}>
                            <Tab.Screen name="Home" component={HomeScreenTab} />
                            <Tab.Screen name="Profile" component={ProfileScreenTab} />
                            <Tab.Screen name="Rewards" component={RewardsScreenTab} />
                            <Tab.Screen name="Betslip" component={BetslipScreenTab} />
                        </Tab.Navigator>
                    </NavigationContainer>

            </>
        )
    }
}

const styles = StyleSheet.create({

    redText: {
        color: '#ed1532'
    },
    darkGreyBackground: {
        backgroundColor: '#161616',
    }

});
